import React from 'react';
import { Link } from 'react-router-dom';
import HeaderLarge from 'views/components/display/HeaderLarge';

export default class PageExpired extends React.Component {
  render() {
    return (
      <>
        <HeaderLarge displayName={"Your session expired"} />

        <p><Link to={"/" + this.props.form + "/Description"}>Return to FormName</Link></p>
      </>
    );
  }
}
